import React from 'react'

function FormInput(props){

    let {
        title,
        onChange,
        value
    } = props;

    return(
        <div className="text-input-container">
                <div className="input-title">{title}</div>
                <input
                  className="text-input"
                  type="email"
                  name="email"
                  onChange={onChange}
                  value={value}
                />
              </div>
    )

}

export default FormInput;
